  `company_email` varchar(50) NOT NULL,
  `company_phone` varchar(45) DEFAULT NULL,
  `company_fax` varchar(45) DEFAULT NULL,
  `company_address` varchar(255) DEFAULT NULL,
  `company_country_id` int(11) NOT NULL,
