insert  into `products`(`product_id`,`product_type_id`,`merchant_id`,`product_name`,`product_description`,`featured`,`area_id`,`product_icon`,`product_link`,`product_price`,`status`,`savings`,`quantity`,`expiry_date`) values (2,4,4,'Mendez Medical Group 3-in-1 Underarm','Unlimited sessions of IPL + Whitening + Excessive Sweating Treatment for the Underarm (valued at P96000)',1,1,'3_royal-view.jpg','http://www.ensogo.com.ph/manila/royal-view-seafood-restaurant-set-meal-11222013.html',0.00,1,'',2000,'2013-12-01 03:01:51'),(3,4,4,'Soiree Salon and Spa L Oreal Steam Bond','<p ><span ><strong ><em >Get rid of the frizz and unwanted curls as you tame down your hair with a L’Oreal Steam Bond treatment at Soiree Salon and Spa.</em></strong></span></p><br ><ul class=\"disc\" ><li >Steam Bond is a newly introduced technology in the wide sphere of hair industry which is considered as the First High Pressure Steam System that revamps and smoothens the hair with steam-activated technology with Pro-Keratin. With the Mythic Oil Blow Dry, it gives an unmatched nourishment, silkiness and shine.</li><li >This treat is valid for any hair length and each session lasts 3 to 4 hours. The process lasts as long as it takes for your natural hair to grow out to a point that it begins to return to its natural state, and then you would have retouches done.</li><li >Choose from the following packages:<ul class=\"circle\" ><li >Package 1: L’Oreal Steam Bond</li><li >Package 2: L’Oreal Steam Bond for any hair length + Pro Keratin Treatment + Mythic Oil Blow Dry</li><li >Package 3: L’Oreal Steam Bond for any hair length + Pro Keratin Treatment + Mythic Oil Blowdry + Manicure and Chocolate Mint Express Spa Pedicure</li></ul></li></ul>',1,1,'soiree.jpg','http://www.ensogo.com.ph/manila/royal-view-seafood-restaurant-set-meal-11222013.html',0.00,1,'68',1000,'2013-12-01 03:01:51'),(4,3,5,'Crabpot Unlimited Seafood Buffet','<p ><span ><strong ><em >Enjoy nbsp;</em></strong><strong ><em >savory</em></strong><strong ><em >&nbsp; seafood goodness while singing your&nbsp;</em></strong><strong ><em >favorite</em></strong><strong ><em >songs with Seafood buffet with KTV at Crabpot Crawfish or Justine’s Paluto.</em></strong></span></p><p ><em >&nbsp; </em></p><ul class=\"disc\" ><li >Feed your hungry tummy with a delicious eat-all-you-can Seafood buffet from Crabpot Crawfish or Justine’s Paluto.</li><li >Sing your voices out as this Livingsocial treat includes a 3-hour use of the restaurant’s KTV room.</li><li >Marvel on a variety of freshly cooked dishes of mixed seafood, fish and crabs like crab marites, fish fillet, calamares, buttered chicken, pork and clam soup. Pair it up with a fresh batch of warm rice.</li><li >Complete your meal with a sweet selection of unlimited Filipino desserts and tea.</li><li >What is included in the seafood eat all you can are:<ul class=\"circle\" ><li >Crabs</li><li >Calamares</li><li >Hipon</li><li >Clams or Halaan</li><li >Mixed Seafood (tahong etc)</li><li >Soup</li><li >Buttered Chicken</li></ul></li><li >Bring your family, friends or officemates with you as the following KTV rooms can accommodate these specific number of persons:<ul class=\"circle\" ><li >Room 1: 5 to 15 persons</li><li >Room 2: 15 to 30 persons</li><li >Room 3: 35 to 50 persons</li><li >Room 4: 50 t0 100 persons</li><li >Room 5: 100 to 150 persons</li></ul></li></ul>',3,1,'crabpot1.jpg','http://www.ensogo.com.ph/manila/fresh-n-juicy-justines-paluto-buffet-w-ktv-11212013.html',0.00,1,'56',1000,'2013-12-01 03:05:29'),(5,3,5,'Royal View Seafood Restaurant Set Meal','<p ><span ><strong ><em >Indulge in a regal dining affair by savoring this Set Meal&nbsp;</em></strong><strong ><em >for 4 at&nbsp;</em></strong><strong ><em >RoyalView Seafood Restaurant.</em></strong></span></p><ul class=\"disc\" ><li><font color=\"#707070\" face=\"Arial, Helvetica, sans-serif\"><span ><b><i><br></i></b></span></font></li><li >Share the royal goodness of this class-A restaurant with your family or friends with the offered Set Meal of Rich in flavor, vibrant colors, mouthwatering presentation, and servings, spoil the palate with the following inclusions:<ul class=\"circle\" ><li >Soyed Chicken with Roasted Barbeque Pork</li><li >Tomatoes with Japanese Crabstick Soup</li><li >Steamed Shrimps</li><li >Crab with Sotanghon in Sate Sauce</li><li >Steamed Lapu-lapu</li><li >Free dessert (Black Gulaman)</li></ul></li><li >RoyalView Seafood Restaurant delivers impressive Chinese dining experience that satisfies fastidious palates. With their imperial ambiance as Manila Bay as the milieu, high-quality culinary offerings prepared by excellent chefs, and accommodating staff, you are the king or queen of this Chinese gastronomic kingdom.</li></ul><span >Purchase period: November 22, 2013 to December 05, 2013.</span>',5,1,'3_royal-view.jpg','http://www.ensogo.com.ph/manila/royal-view-seafood-restaurant-set-meal-11222013.html',1280.00,1,'68',2000,'2013-12-01 03:43:47');

/*Table structure for table `products_areas` */

DROP TABLE IF EXISTS `products_areas`;

CREATE TABLE `products_areas` (
  `area_id` int(11) NOT NULL AUTO_INCREMENT,
  `area_name` varchar(55) NOT NULL,
  `area_description` varchar(255) NOT NULL,
  `area_active` tinyint(1) NOT NULL DEFAULT '1',
  `area_country_id` int(11) NOT NULL,
  PRIMARY KEY (`area_id`),
  UNIQUE KEY `area_id_UNIQUE` (`area_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

